import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { Provider } from "mobx-react";
import reportWebVitals from './reportWebVitals';
import { LayoutProvider } from './components/Core/context/LayoutContext';
import { UserProvider } from './components/Core/context/LayoutContext';
import { ThemeProvider as ThemeProviderV5 } from '@mui/material/styles';
import { ManagementProvider } from './components/Core/context/ManagementContext';
import {
       ThemeProvider as ThemeChangeProvider,
       ThemeStateContext,
} from './components/Core/context/ThemeContext';
import CssBaseline from '@mui/material/CssBaseline';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

       <LayoutProvider>
              <StyledEngineProvider injectFirst>
                     <ThemeChangeProvider>
                            <ThemeStateContext.Consumer>
                                   {(theme) => (
                                          <ThemeProviderV5 theme={theme}>
                                                 <ManagementProvider>
                                                        <CssBaseline />
                                                        <App />
                                                 </ManagementProvider>
                                          </ThemeProviderV5>
                                   )}
                            </ThemeStateContext.Consumer>
                     </ThemeChangeProvider>
              </StyledEngineProvider>

       </LayoutProvider>

);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
